from django.conf import settings
from django.core.management import call_command
from django.core.management.base import BaseCommand

from itemManagement.models import Location, Item, Photo, ItemStorage, Tag
from security.models import User
import base64


class Command(BaseCommand):
    args = ''
    help = 'Populates development databases with fake data'

    def _overwrite_db(self):
        if not getattr(settings, "DEBUG", False):
            raise Exception("ERROR: Can't run in production")

        call_command('flush')  # Clears the entire db

        # Create a test user

        print("Making new user")
        user = User.objects.create_user(email="mocpzz_scott@icloud.com", password="abcd", is_superuser=True)
        user.receivesAlerts = True
        user.save()
        assert user.password != "abcd"

        user = User.objects.create_user(email="a@a.com", password="abcd", is_superuser=True)
        user.receivesAlerts = True
        user.save()
        assert user.password != "abcd"

        user = User.objects.create_user(email="b@b.com", password="abcd", is_superuser=False)
        user.save()
        assert user.password != "abcd"

        mainStorage = Location.objects.create(name="Main Storage Area")
        kennel = Location.objects.create(name="Kennel")

        itemOne = Item.objects.create(
            title="NaCl 0.9% 500ml",
            description="itemOne"
        )
        itemTwo = Item.objects.create(
            title="Puppy",
            description="item Two"

        )
        itemThree = Item.objects.create(
            title="Puppy 2",
            description="item Three"
        )
        itemFour = Item.objects.create(
            title="ADAPT FEED BOLUS BFA-20-S",
            kghID=95988,
            price=4.5

        )

        ItemStorage.objects.create(item=itemOne, location=mainStorage, quantity=15)
        ItemStorage.objects.create(item=itemTwo, location=kennel, quantity=385)
        ItemStorage.objects.create(item=itemThree, location=kennel, quantity=50)

        Photo.objects.create(
            mimeType="image/jpeg",
            data=base64.b64decode("".encode("utf8")),
            order=1,
            depicts=itemOne
        )
        Photo.objects.create(
            mimeType="image/jpeg",
            data=base64.b64decode("".encode("utf8")),
            order=1,
            depicts=itemTwo
        )
        puppy2 = base64.b64decode("".encode("utf8"))

        Photo.objects.create(
            mimeType="image/jpeg",
            data=puppy2,
            order=1,
            depicts=itemThree
        )
        Photo.objects.create(
            mimeType="image/jpeg",
            data=puppy2,
            order=1,
            depicts=itemTwo
        )

        Tag.objects.create(
            name="solution",
            item=itemOne
        )
        Tag.objects.create(
            name="dog",
            item=itemTwo
        )
        Tag.objects.create(
            name="gold",
            item=itemTwo
        )
        Tag.objects.create(
            name="dog",
            item=itemThree
        )

    def handle(self, *args, **options):
        self._overwrite_db()
